pragma solidity >=0.7.0 <0.9.0;
pragma experimental ABIEncoderV2;

contract ChatApp {
    // Add an enum to represent the user category
    enum Category { Patient, Doctor }

    // Update the User structure to include the category.
    struct User {
        string name;
        uint8 category;  // 0 for Patient, 1 for Doctor
    }

    mapping(address => User) private userList;

    // Add these structs and mappings near the top of the contract
    struct PatientSettings {
        string patientDataCID;
        string[] documentCIDs;
        uint256 lastUpdated;
    }

    mapping(address => PatientSettings) private patientSettings;
    mapping(address => mapping(address => bool)) private authorizedProviders;

    // Events for tracking changes
    event PatientSettingsUpdated(address indexed patient, uint256 timestamp);
    event ProviderAuthorized(address indexed patient, address indexed provider, bool status);

    // Function to check if a patient has settings
    function hasPatientSettings(address patient) public view returns (bool) {
        return bytes(patientSettings[patient].patientDataCID).length > 0;
    }

    // Function to get patient settings
    function getPatientSettings(address patient) external view returns (PatientSettings memory) {
        require(msg.sender == patient || authorizedProviders[patient][msg.sender], "Not authorized");
        require(checkUserExists(msg.sender), "User not registered");
        require(hasPatientSettings(patient), "No settings found");
        return patientSettings[patient];
    }

    // Function to update patient settings
    function updatePatientSettings(string calldata patientDataCID, string[] calldata documentCIDs) external {
        require(checkUserExists(msg.sender), "User not registered");
        require(bytes(patientDataCID).length > 0, "Invalid CID");
        patientSettings[msg.sender] = PatientSettings(patientDataCID, documentCIDs, block.timestamp);
        emit PatientSettingsUpdated(msg.sender, block.timestamp);
    }

    // Function to authorize/deauthorize a provider
    function setProviderAuthorization(address provider, bool authorized) external {
        require(checkUserExists(msg.sender), "User not registered");
        require(checkUserExists(provider), "Provider not registered");
        authorizedProviders[msg.sender][provider] = authorized;
        emit ProviderAuthorized(msg.sender, provider, authorized);
    }

    // Example checkUserExists function
    function checkUserExists(address pubkey) public view returns (bool) {
        return bytes(userList[pubkey].name).length > 0;
    }

    // Create account now accepts a category parameter as uint8.
    // Patients should call with 0 and Doctors with 1.
    function createAccount(string calldata _name, uint8 _category) external {
        require(!checkUserExists(msg.sender), "User already registered");
        require(_category <= uint8(Category.Doctor), "Invalid category");
        // Store the new user along with its category
        userList[msg.sender] = User(_name, _category);
        emit UserRegistered(msg.sender, _name, _category);
    }

    // Event for tracking user registration
    event UserRegistered(address indexed user, string name, uint8 category);

    // ... rest of contract code (patient settings, messaging, etc.) ...
}

